generated.css:
.contacts{
    height: 220px;
    display: flex;
    width: 100%;
    flex-direction: column;
    justify-content: center;   
    position: relative;
}

.contacts-list{
    display: flex;
    width: 0 auto;
    flex-direction: column;
    font-size: 12pt;
    justify-content: center;
    align-content: center;
    text-align: center;
}

.contacts-list > div{
    display: flex;
    width: 0 auto;
    justify-content: left;
    font-size: 14pt;
    margin-bottom: 10pt;
}

.contacts-list > div > i{
    margin-right: 20pt;
}

/*mobile*/
@media only screen and (max-width: 768px) {
    .contacts{
        margin-bottom:0px;
        margin-top:0px;
        display: flex;
        flex-direction: column;
        text-align: center;
        height: auto;
    }
}
